// src/components/Footer.js
import React from 'react';
import './Footer.css';

function Footer() {
  // Function to copy email to clipboard
  const copyEmailToClipboard = () => {
    navigator.clipboard.writeText('unswpsychsoc@example.com');
    alert('Email copied to clipboard!');
  };

  return (
    <footer className="footer">
      <div className="footer-content">
        <div className="social-links">
          <div onClick={copyEmailToClipboard} className="social-icon email">
            Email
          </div>
          <a href="https://instagram.com/yourpage" target="_blank" rel="noopener noreferrer" className="social-icon instagram">
            Instagram
          </a>
          <a href="https://discord.com/invite/yourinvitecode" target="_blank" rel="noopener noreferrer" className="social-icon discord">
            Discord
          </a>
        </div>
      </div>
    </footer>
  );
}

export default Footer;
